const  [hide, sethide]= useState(false);
const show_hide=()=>{
    sethide(!hide)
}

  return (
    <div className='top'>

<button onClick={ show_hide}>
    click me
</button>

<Sidebar   data={hide}/>

    </div>


  )
}

export default Topbar
